Defendant Joshua J Warren in court with attorney Anne M Jaspers.  Jesica A Ballenger appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.

AS TO COUNT 1:  The defendant was advised of his constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  

AS TO COUNT 2:  By operation of law and on motion of the state the Court ordered Count 2 DISMISSED.

AS TO COUNTS 3 AND 4:  Pursuant to plea negotiations and on motion of the state the Court ordered Counts 3 and 4 DISMISSED AND READ-IN for sentencing.

Sentencing proceeded.  Statements made by the state, defense and defendant. 

AS TO COUNT 1:  The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 4 YEARS, CONSECUTIVE to any other time being served with credit for 1day served. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 2 YEARS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 2 YEARS.  The defendant IS eligible for the Challenge Incarceration Program and the Substance Abuse Program.

The Court STAYED this sentence and placed the defendant on probation for a period of 3 YEARS with the following conditions.

CONDITIONS OF PROBATION/EXTENDED SUPERVISION:
*Serve 10 MONTHS in the House of Corrections with Huber privileges for employment, treatment, school, and childcare ONLY IF EMPLOYED.  IF NOT EMPLOYED, the Court orders Huber release to the Day reporting center ONLY.  NO ELECTRONIC MONITORING ALLOWED. 
*Obtain AODA assessment- complete follow-up treatment;
*Absolute sobriety, no drugs or alcohol- random urine screens and breathalyzer tests;
*No illegal drug dealing or association with drug community (drug users/dealers/houses);
*Cooperate with all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*Obtain/maintain full time employment, if enrolled in school full time, part time work;
*Pay all supervision fees;
*Provide DNA sample if not previously submitted- pay surcharge;

The Court ordered defendant to pay a fine of $1800.00 plus all mandatory costs, penalties, surcharges, including $50.00 ignition interlock surcharge- bail to apply; balance to be paid by the end of probation period.  Any remaining balance to convert to civil judgment.  The Court to allow defendant to perform community service in exchange for monetary credit towards court ordered financial obligations.  Defendant may receive a $10.00  credit for every (1) hour of community service towards financial obligations up to $100.00 maximum.  Court ordered AODA assessment and Driver's Safety Plan; cooperate with any treatment recommended.  Court ordered defendant's driving privileges revoked for a period of 36 months.  Court ordered defendant restricted to operation of vehicles equipped with an ignition interlock device for 36 months.   The Court ordered that all financial obligations  be paid through collection of sums by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.  Appeal rights provided by the Court.
